  `humidity` int(2) DEFAULT '0' COMMENT '湿度',
  `mac_loss` int(2) DEFAULT '0' COMMENT '损耗',
  `tea_grade_one` double(9,2) DEFAULT '0.00' COMMENT '筛选工序后，一级茶叶数量',
  `tea_grade_two` double(9,2) DEFAULT '0.00' COMMENT '筛选工序后，二级茶叶数量',
